import React from 'react';
import AddUser from './components/User/AddUser';


function App() {
  const addUserHandler=(e)=>{
    e.preventDefault();
    console.log(e.target);
  }
  return (
    <div>
      <AddUser onUserAdd={addUserHandler}/>
    </div>
  );
}

export default App;
